import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" aria-hidden="true" style={{
    msTransform: "rotate(360deg)",
    WebkitTransform: "rotate(360deg)"
  }} viewBox="0 0 2000 2000" transform="rotate(360)" {...props}><rect width={1700} height={1360} x={150} y={-627.638} rx={311.337} ry={306} fill="transparent" stroke="#626262" strokeWidth={220} strokeLinecap="round" transform="translate(0 947.638)" /></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" aria-hidden="true" focusable="false" width="1em" height="1em" style="-ms-transform: rotate(360deg); -webkit-transform: rotate(360deg); transform: rotate(360deg);" preserveAspectRatio="xMidYMid meet" viewBox="0 0 2000 2000"><rect width="1700" height="1360" x="150" y="-627.638" rx="311.337" ry="306" fill="transparent" stroke="#626262" stroke-width="220" stroke-linecap="round" transform="translate(0 947.638)"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
